import React, { Component } from "react";
let stars = [];

function starfill() {
  for (let i = 0; i < 1000; i++) {
    stars.push("x");
  }
}
export default class Starback extends Component {
  componentDidMount() {
    starfill();
  }
  render() {
    return (
      <div>
        <h2>hello calle</h2>
        <div>{stars}</div>
      </div>
    );
  }
}
